import art07 from "./../img/art/art07.jpg";
import art03 from "./../img/art/art03.jpg";
import art05 from "./../img/art/art5.jpg";

const Contacts = () => {
  return (
    <div>
      <main className="section">
        <div className="container">
          <h1 className="title-1">Contacts</h1>

          <ul className="content-list">
            <li className="content-list__item">
              <h2 className="title-2">Location</h2>
              <p>Moscow, Russia</p>
            </li>
            <li className="content-list__item">
              <h2 className="title-2">Telegram / WhatsApp</h2>
              <p>
                <a href="tel:+79051234567">+7 (905) 123-45-67</a>
              </p>
            </li>
            <li className="content-list__item">
              <h2 className="title-2">Email</h2>
              <p>
                <a href="mailto:webdev@protonmail.com">webdev@protonmail.com</a>
              </p>
            </li>
          </ul>
        </div>
      </main>
    </div>
  );
};

export default Contacts;
